import logo from './logo.svg';
import './App.css';
import {useEffect, userEffect, useState} from 'react';
function App() {
  useEffect(() => {
    fetch('http://localhost:3033/users')
    .then(res => res.json)
    .then(data => setData(data))
    .catch(err => console.log(err))

  },[])
  return (
    <div>
      <table>
        <thead>
          <th>ID</th>
          <th>Name</th>
          <th>Email</th>
        </thead>
        <tbody>
          {data.map((item, index) => {
            return(
              <tr key={index}>
                <td>{item.id}</td>
                <td>{item.name}</td>
                <td>{item.email}</td>
              </tr>
            )
          })}
        </tbody>
      </table>
    </div>
  );
}

export default App;
